import store from './App/store';
import { Provider } from 'react-redux';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
      <Provider myStore={store}>
  //   <React.StrictMode>

       <App />

  //  </React.StrictMode>
     </Provider>
);

